@Sismos_Peru_IGP 🟢Sexto sismo reportado frente a la zona de Marcona-Lomas en 3 días (68 horas).
Estos sismos se originan por el proceso de subducción de placas, influenciado por la dorsal de Nazca.
⚠️ Esta zona presenta acoplamiento sísmico (M7.7 1996, M7.1 2013, M7.1 2018, M7.2 2014). https://t.co/2FLCD1nFca
